import{_ as e,c as o,o as s,b as t}from"./app.5b22e94d.js";const v=JSON.parse('{"title":"周末","description":"","frontmatter":{"title":"周末","date":"2018-08-06T00:00:00.000Z","draft":false,"tags":[2018]},"headers":[],"relativePath":"note/2018/2018080602.md"}'),n={name:"note/2018/2018080602.md"},_=t("p",null,"刚吃完饭回来，买了一杯森林玫果，刀削面用了八块钱，饮料四块，刚好是十二块。本来想吃米饭的，不过周围的店都关门类，走了好远，才看到一家刀削面店，里面人很多，比较凉快。装饰很舒服，那种木质的桌椅，打扫也很干净，有种舒服的感觉。边吃边看了一会美剧，讲魔术师帮警察破案的故事，比较有意思，不过我是个看脸的人，如果主角让我看着不舒服的话，我是不会看到，对，我就是看脸。然后，剧情的话，一般，我勉强能够接受。",-1),a=t("p",null,"然后，现在我已经回到了自己的小屋子里，放起音乐，写下这些。本来打算研读我搜到的资料的，但是感觉不在状态，因为后脑勺那块一点不舒服，这让我不想去思考问题，所以我决定看看下载的日剧，非正常死亡，不得不说，这部剧，主句配角都很舒服，看起来不扎眼，不会出戏，然后剧情紧密，情节起伏，看起来很舒服。日本人的做事态度是真的值得学习，认真，只能用这两个字形容。",-1),l=t("p",null,"看一会，然后我就睡觉，我估计，是睡眠不够造成的，因为早上起来早了，那个时候，起来的时候，后脑勺就有点不舒服，应该继续睡的，我之前有经验。起来的时候，我一定要学习，我一定要，我不要放弃那些梦想。",-1),c=t("p",null,"又到了为一周做总结的时候，这周说实话，平淡无奇，没发生什么大事情，我也没有什么进步，没有什么变化，仍然是踌躇满志，整装待发，我不知道我这样等待了多久，不知道在等一个怎样的时机。",-1),d=t("p",null,"我知道随时都可以出发，却不敢踏出一步，因为我知道，前面有太多困难，一想到那些无法预料的困难，仿佛就在面前，拦着我，不让我走，于是有了推脱的理由，拖延的借口，不幸的是，时间依旧不紧不慢的流动着，有时候感觉快，有时候感觉慢。",-1),r=t("p",null,"所幸我有了前所未有的觉悟，也踏出第一步，确实很难，但是我不能放弃啊，必经之路。然后是，一想到只有几天又能见慕慕，有点激动，但是我要平衡工作娱乐学习和爱情，真的是，事情越多，越无法平衡，变量越多，越无法预测。",-1),i=t("p",null,"我这样，努力些自己的框架，把那些没明白的弄明白。",-1),p=t("p",null,"这算什么总结，总结就是，再接再厉，砥砺前行，乘风破浪，羽化而归。",-1),u=[_,a,l,c,d,r,i,p];function h(f,m,$,x,B,g){return s(),o("div",null,u)}const N=e(n,[["render",h]]);export{v as __pageData,N as default};
